syntax = "proto3";

package io.pranludi.crossfit.branch.protobuf;

option java_package = "io.pranludi.crossfit.branch.protobuf";
option java_multiple_files = true;

import "google/protobuf/timestamp.proto";

message BranchDTO {
  string id = 1;
  string password = 2;
  string name = 3;
  string email = 4;
  string phone_number = 5;
}
